INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130011, "ヤマト", 0.0, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2030/01/01 14:59:59", 2, 2.1, 1, -416.5, "2024/10/31 12:00:00", 100, 3001100, 3001);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130011, "ヤマト", 0.0, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "2030/01/01 14:59:59", 2, 5.68, 4, -416.5, "2024/10/31 12:00:00", 101, 3001101, 3001);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130011, "ヤマト", 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "2030/01/01 14:59:59", 1, 0.0, 1, -416.5, "2024/10/31 12:00:00", 102, 3001102, 3001);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "2030/01/01 14:59:59", 1, 0.0, 1, -416.5, "2024/10/31 12:00:00", 100, 3002100, 3002);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "2030/01/01 14:59:59", 1, 0.0, 1, -416.5, "2024/10/31 12:00:00", 101, 3002101, 3002);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "2030/01/01 14:59:59", 2, 8.53, 5, -416.5, "2024/10/31 12:00:00", 102, 3002102, 3002);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "2030/01/01 14:59:59", 1, 5.67, 7, -416.5, "2024/10/31 12:00:00", 103, 3002103, 3002);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "2030/01/01 14:59:59", 1, 0.0, 1, -416.5, "2024/10/31 12:00:00", 104, 3002104, 3002);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "2030/01/01 14:59:59", 3, 0.0, 3, -416.5, "2024/10/31 12:00:00", 300, 3002300, 3004);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "2030/01/01 14:59:59", 7, 0.0, 7, -416.5, "2024/10/31 12:00:00", 301, 3002400, 3005);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "2030/01/01 14:59:59", 1, 4.4, 2, -416.5, "2024/10/31 12:00:00", 200, 3003200, 3003);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "2030/01/01 14:59:59", 7, 0.0, 7, -416.5, "2024/10/31 12:00:00", 201, 3003201, 3003);
INSERT INTO `v1_30bbf4351bf0ffede57330108466f32d07896de0833ab983ec2ba956ed35792b` VALUES (130211, "フブキ", 0.0, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "2030/01/01 14:59:59", 2, 5.6, 1, -416.5, "2024/10/31 12:00:00", 202, 3003202, 3003);
